        require(controllers[msg.sender], "Only controllers can mint");
        _mint(account, amount);
        return true;
    }

    /**
    * @dev Destroys `amount` tokens and assigns them to `_msgSender()`, reducing
    * the total supply.
    *
    * Requirements
    *
